import React from 'react';

import { Button } from '@mui/material';

const CustomButton = (props) => {
  const { backgroundColor, title } = props;
  return (
    <Button
      variant="contained"
      style={{
        width: '110px',
        textTransform: 'none',
        padding: '10px',
        margin: '5px',
        backgroundColor
      }}>{title}</Button>
  )
}

